svg.script:
webMI.data.subscribe(webMI.query["base"] + ".Alarma", function(e) {
var id = "id_1";
var value = e.value;
if (value == true)
	webMI.gfx.setFill(id, "#ff0000");
if (value == false)
	webMI.gfx.setFill(id, "#00aa00");

});


webMI.data.subscribe(webMI.query["base"] + ".name", function(e) {
var id = "id_0";
var value = e.value;
webMI.gfx.setText(id, value);

});



webMI.data.subscribe(webMI.query["base"] + ".PPM", function(e) {
var id = "id_2";
var value = e.value;
webMI.gfx.setText(id, webMI.sprintf("%.2f", value));

});
